  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset of administrative records contains
  discretionary grant recipients who were awarded funds by the Institute of Museum
  and Library Services  from fiscal year 1996 through fiscal year 2013. Included in
  this dataset are: the name of the institution, the name of the grant project, the
  amount of the IMLS grant award, the amount of matching funds the applicant provided
  and the start and end dates of the grant period.  Geographic information, such as
  the latitude and longitude of the grantees' street addresses, the census tract and
  block group the grantee institution is located in, and the state and county of the
  grantee, is also included in the dataset.\",\n\t\"license_title\": \"Other License
